    <div className='wrapper'>

      <div className='procard'>

      {
        data.map((item)=>{
            return(<div>
        <div className='proimg'>{item.images}</div>
        <div className='protitle'><h3>protitle</h3></div>
        <div className='proprice'><h3>proprice</h3></div>
        <div className='probrand'><h3>probrand</h3></div>
